Monitor vehicles and stationary assets with IoT Solution Online. The app allows:
- managing the working list of units being tracked: data on movement and ignition status, information relevance, and units location is always at hand on a real time basis;
- working with the map: access to units, geofences, tracks, and event markers as well as defining your own location on the map is no longer an issue;
- working in a monitoring mode: tracking the location and parameters of each and every unit has never been easier;
- controlling events: their duration, chronology, and number as well well as the data on trips, stops, fillings, thefts, and sensors values are available at any time;
- receiving and viewing notifications on the screen of the mobile device;
- creating and sharing links to the vehicles current location;
- sending commands for remote setup.
